import React from 'react';
import dynamic from 'next/dynamic';

const ImageZoom = dynamic(() => import('./ImageZoom'), {
  ssr: false,
});

export default function ProductDetail(props) {
  const { data } = props;

  return (
    <div className="">
      <ImageZoom images={data.images} />
    </div>
  );
}
